import React from "react";

const Body = ({ wrongLetters, playAgain }) => {
  const errors = wrongLetters.length;

  console.log(errors);
  return (
    <svg height="250" width="200" className="figure-container">
      <button onClick={playAgain}>Play Again</button>
      {/* <!-- Rod --> */}
      {/* <!-- Head --> */}
      {errors !== 0 && <line x1="60" y1="20" x2="140" y2="20" />}
      {errors !== 0 &&<line x1="140" y1="20" x2="140" y2="50" />}
      {errors !== 0 && <line x1="60" y1="20" x2="60" y2="230" />}
      {errors !== 0 && <line x1="20" y1="230" x2="100" y2="230" />}
      {/* <!-- Head --> */}
      {errors > 0 && <circle cx="140" cy="70" r="20" />}
      {/* <!-- Body --> */}
      {errors > 1 && <line x1="140" y1="90" x2="140" y2="150" />}
      {/* <!-- Arms --> */}
      {errors > 2 && <line x1="140" y1="120" x2="120" y2="100" />}
      {errors > 3 && <line x1="140" y1="120" x2="160" y2="100" />}
      {/* <!-- Legs --> */}
      {errors > 4 && <line x1="140" y1="150" x2="120" y2="180" />}
      {errors > 5 && <line x1="140" y1="150" x2="160" y2="180" />}
    </svg>
  );
};

export default Body;
